const fruit = [
    {id: 0, src: require('./images/fruits/tile000.png'), alt: 'tile000'},
    {id: 1, src: require('./images/fruits/tile001.png'), alt: 'tile001'},
    {id: 2, src: require('./images/fruits/tile002.png'), alt: 'tile002'},
    {id: 3, src: require('./images/fruits/tile003.png'), alt: 'tile003'},
    {id: 4, src: require('./images/fruits/tile004.png'), alt: 'tile004'},
    {id: 5, src: require('./images/fruits/tile005.png'), alt: 'tile005'},
    {id: 6, src: require('./images/fruits/tile006.png'), alt: 'tile006'},
]

function imageLoader()
{
    return fruit;
}

export default imageLoader;
